import * as React from 'react';

export const GotYourBack = () => {
  return (
    <div className='relative w-screen py-16 bg-white'>
      <div className='lg:max-w-5xl mx-auto mb-16'>
        <div className='grid grid-cols-2'>
          <div className='w-70p'>
            <h3
              style={{ fontFamily: 'airbnb-bold' }}
              className='text-3xl text-gray-750 leading-9'>
              We've got your back, every step of the way
            </h3>
          </div>
          <div>
            <p style={{ fontFamily: 'airbnb-book' }} className='text-gray-750'>
              Resources like articles and insights dedicated to your hosting
              needs, 24/7 customer support for you and your guests, exposure for
              your experience, and much more.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};
